  b 18.07.1913
  Dudley b. at Wellington, Georgina, d/o Captain T W H Sarll and Sybil Athelstan Smith.
  Address: Shore Cottage, 42 Shore Road, Warsash, Hants S03 9FU, England.
  Dudley was a regular officer (Group Captain on retirement) in the Royal Air Force and saw
  'active service in WW2. He trained at Cranwell RAF College and flew Lancasters during WW2 in
  bombing raids on Germany. He was awarded the DFC. He was also a keen yachtsman. Following
  the war, Dudley and Georgina spent six years in New Zealand before returning to England.
