  Josephine Leverett, b. at Burnwell, Norfolk, England. Address: 3 Halifax Road, Bicester, Oxon OX6 8LY,
  England.
  Rosemary trained as a dental nurse, served in the WRAF and worked as a physiotherapy aide. Kenneth
